import React from 'react';
import styled from 'styled-components';

const Banner = styled.div`
  width: 100vw;
  height: 200px;
  background-image: url(/bannerimg.jpg);
  background-size: cover;
  background-position: center;
`;

function TopBanner() {
    return <Banner />;
}

export default TopBanner
